import React from 'react';
import ReactDOM from 'react-dom/client';
import FunctionalComponent from './FunctionalComponent';
import { ClassComponent } from './ClassComponent';
import PropsInFunctionalComponentReact from './PropsInFunctionalComponent';
import PropsInClassComponent from './PropsInClassComponent';
import StateInFunctionalComponent from './StateInFunctionalComponent';
import StateInClassComponent from './StateInClassComponent'
import ListAndKey from './List&Keys';
import Routing from './pages/Routing';
import UseEffectHook from './useEffectInReact';
import UseReducerHook from './useReducerHook';
import { Provider } from 'react-redux';

let root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <Provider>
        <React.StrictMode>
        <Routing />
        <FunctionalComponent />
        <ClassComponent />
        <PropsInFunctionalComponentReact name="Mansoor" age="20" />
        <PropsInClassComponent yoe='2' salary='3.75' />
        <StateInFunctionalComponent />
        <StateInClassComponent />
        <ListAndKey />
        <UseEffectHook />
        <UseReducerHook />
    </React.StrictMode>
    </Provider>

);
